import style from './VisualizarUsuario.module.scss';

export const VisualizarUsuario = ({id}) => {
    
    console.log(id)

    return(
        <>
            {id ? 
            <div className={style.container}>
                <div className={style.titulo}>
                    <p>Nome:</p>
                </div>
                <div className={style.content}>
                    <p>{id.nome}</p>
                </div>
            </div>: 
            <p>Loading...</p>}
        </>
    )
}
